import React from "react";
import '../../index.css';

function Table({items, initialInvestment}) {
  console.log(items);

    return (
        <table className="result">
        <thead>
          <tr>
            <th>Year</th>
            <th>Total Savings</th>
            <th>Interest (Year)</th>
            <th>Total Interest</th>
            <th>Invested Capital</th>
          </tr>
        </thead>
        <tbody>
        {items.map((calculation) => (
          <tr>
        <td>{calculation.year}</td>
        <td>${calculation.savingsEndOfYear}</td>
        <td>${calculation.yearlyInterest}</td>
        <td>${calculation.savingsEndOfYear - initialInvestment -  calculation.yearlyContribution * calculation.yearlyInterest}</td>
        <td>${calculation.yearlyContibution}</td>
        </tr>
        ))}
        </tbody>
      </table>
    )
}

export default Table;
